def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    # TODO: the actual managing of mgr_locs is a PITA
    # here, it should happen via BlockManager.combine

    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data._get_numeric_data()

    agg_blocks: List[Block] = []
    new_items: List[np.ndarray] = []
    deleted_items: List[np.ndarray] = []
    # Some object-dtype blocks might be split into List[Block[T], Block[U]]
    split_items: List[np.ndarray] = []
    split_frames: List[DataFrame] = []

    for blk in data.blocks:
        try:
            blk=_agg_1d(blk, h, how, min_count)
        except Exception as e:
            if alt is not None:
                try:
                    alt = True
                    blk=_agg_1d(blk, h, alt, min_count)
                except Exception as e:
                    print(e)
                    deleted_items.append(blk.mgr_locs.as_array)
            else:
                print(e)
                deleted_items.append(blk.mgr_locs.as_array)
        finally:
            if isinstance(blk, type(blocks.default_blknos)):
                agg_blocks.append(blk)
                new_items.append(blk.mgr_locs.as_array)
            else:
                split_items.append(blk.mgr_locs.as_array)
                split_frames.append(blk)

    if len(split_items) > 0:
        agg_blocks.extend([blocks.concat(spl) for spl in split_frames])
        new_items.extend(split_items)

    # reset the locs in the blocks to correspond to our
    # current ordering
    indexer = np.concatenate(new_items)
    agg_items = data.items.take(np.sort(indexer))

    if len(deleted_items) > 0:
        indexer = _reorder_deletes(indexer, deleted_items, len(data))

    offset = 0
    for blk in agg_blocks:
        loc = len(blk.mgr_locs)
        blk.mgr_locs = indexer[offset : (offset + loc)]
        offset += loc

    return agg_blocks, agg_items
